<h1 id="adobe-analytics-apis-segments">segments</h1>

## segments_getSegments

<a id="opIdsegments_getSegments"></a>

`GET /segments`

*Retrieve All Segments*

<h3 id="segments_getsegments-parameters">Parameters</h3>

|Name|In|Type|Required|Description|
|---|---|---|---|---|
|rsids|query|string|false|Filter list to only include segments tied to specified RSID list (comma-delimited)|
|segmentFilter|query|string|false|Filter list to only include segments in the specified list (comma-delimited list of IDs)|
|locale|query|string|false|Locale|
|name|query|string|false|Filter list to only include segments that contains the Name|
|tagNames|query|string|false|Filter list to only include segments that contains one of the tags|
|filterByPublishedSegments|query|string|false|Filter list to only include segments where the published field is set to one of the allowable values (all, true, false).|
|limit|query|integer|false|Number of results per page|
|page|query|integer|false|Page number (base 0 - first page is "0")|
|sortDirection|query|string|false|Sort direction (ASC or DESC|
